import React from 'react';
import './custom-btn.styles.scss'

const Custombtn=({children,googlesign,...otherprops})=>(
    <div className="btn-group">
    <button className={
        `${googlesign ? 'googlesign' : ''}  custom-button`} {...otherprops}>{children.toUpperCase()}</button>
    </div>
)

export default Custombtn;
